    event(
      id: 4,
      name: "Duel NPC",
      x: 34,
      y: 14,
      page_0: page(
        graphic: graphic(
          name: "trainer_BLACKBELT",
        ),
        commands: [
          text("\\bHaiiiii-yaaaaaah!"),
          memorize_bgm_bgs,
          fade_out_bgm(seconds: 1),
          wait(20),
          play_bgm(audio(name: "Battle trainer")),
          *comment(
            "Duel Minigame, based on the version written by Alael, ",
            "modified for Pokémon Essentials.",
          ),
          *comment(
            "The duel takes place in a row of 4 tiles, with the ",
            "player and opponent using the centre two. Make ",
            "sure you have enough space.",
          ),
          *comment(
            "3 texts for defense, 3 for precise attacks, 3 for fierce ",
            "attacks, 3 for special attacks.",
          ),
          script("$speeches = []"),
          *script(
            <<~'CODE'
            $speeches.push(
              _I("I shall block all your 
            attacks!"),
              _I("Nothing can pierce my armor!"),
              _I("Behold my dodging skills!")
            )
            CODE
          ),
          *script(
            <<~'CODE'
            $speeches.push(
             _I("I'll show you my fighting 
            skills!"),
              _I("Awe at the perfection of my 
            skills!"),
              _I("I'll deliver a perfect blow!")
            )
            CODE
          ),
          *script(
            <<~'CODE'
            $speeches.push(
              _I("Feel my power!"),
              _I("AAAAHHHH!"),
              _I("I'll attack with all my 
            strength!")
            )
            CODE
          ),
          *script(
            <<~'CODE'
            $speeches.push(
              _I("Face my secret technique!"),
              _I("This is my secret technique!"),
              _I("Evil Blade Strike!")
            )
            CODE
          ),
          *comment(
            "The opponent in a duel needs a trainer type to be ",
            "defined in trainertypes.txt. This is used to display a ",
            "name and graphic for the opponent.",
            "The opponent does NOT need to appear in ",
            "trainers.txt, though.",
          ),
          *condition(
            script: "pbDuel(:BLACKBELT, \"Dan\", get_self, $speeches)",
            then: [
              fade_out_bgm(seconds: 1),
              wait(20),
              restore_bgm_bgs,
              text("\\bYou won, good job."),
            ],
            else: [
              fade_out_bgm(seconds: 1),
              wait(20),
              restore_bgm_bgs,
              text("You lost, too bad."),
            ],
          ),
        ],
      ),
    ),

    event(
      id: 5,
      name: "Shadow trainer - basic",
      x: 14,
      y: 18,
      page_0: page(
        graphic: graphic(
          name: "trainer_TEAMROCKET_M",
          direction: :right,
        ),
        commands: [
          script("pbTrainerIntro(:TEAMROCKET_M)"),
          text("\\bI'm a basic trainer with a Shadow Pokémon."),
          *condition(
            script: "TrainerBattle.start(:TEAMROCKET_M, \"Grunt\", 1)",
            then: [
              control_self_switch("A", :ON),
            ],
          ),
          script("pbTrainerEnd"),
        ],
      ),
      page_1: page(
        self_switch: "A",
        graphic: graphic(
          name: "trainer_TEAMROCKET_M",
          direction: :right,
        ),
        commands: [
          *text(
            "\\bDid you manage to snag my Shadow Pokémon?  ",
            "Because you can't battle me again for another ",
            "chance.",
          ),
        ],
      ),
    ),

    event(
      id: 6,
      name: "Shadow trainer - repeat",
      x: 14,
      y: 19,
      page_0: page(
        graphic: graphic(
          name: "trainer_TEAMROCKET_F",
          direction: :right,
        ),
        commands: [
          script("pbTrainerIntro(:TEAMROCKET_F)"),
          *text(
            "\\rYou can battle me repeatedly, and have unlimited ",
            "attempts to snag my Shadow Pokémon.",
          ),
          *condition(
            script: "TrainerBattle.start(:TEAMROCKET_F, \"Grunt\", 1)",
            then: condition(
              script: "$player.pokedex.owned_shadow_pokemon?(:ELECTABUZZ)",
              then: [
                control_self_switch("A", :ON),
              ],
            ),
          ),
          script("pbTrainerEnd"),
        ],
      ),
      page_1: page(
        self_switch: "A",
        graphic: graphic(
          name: "trainer_TEAMROCKET_F",
          direction: :right,
        ),
        commands: [
          *text(
            "\\rYou've managed to snag my Shadow Electabuzz.  ",
            "I'm not going to do anything now.",
          ),
        ],
      ),
    ),

    event(
      id: 7,
      name: "Purify expert",
      x: 18,
      y: 22,
      page_0: page(
        graphic: graphic(
          name: "trainer_SCIENTIST",
          direction: :left,
        ),
        commands: [
          *text(
            "\\bI can tell you some things about Shadow Pokémon",
            "in Essentials. However, the wiki has far more ",
            "information about them.",
          ),
          label("Choices"),
          text("\\bWhat do you want to know?"),
          *show_choices(
            choices: ["Information", "Shadow Pokémon battles", "Purifying Pokémon", "Exit"],
            cancellation: 4,
            choice1: [
              *text(
                "\\bShadow Pokémon are a special kind of Pokémon ",
                "which appeared in Pokémon Colosseum and ",
                "Pokémon XD.",
              ),
              *text(
                "\\bThey can be included in Essentials as well. See ",
                "the wiki for information on how to do this.",
              ),
              jump_label("Choices"),
            ],
            choice2: [
              *text(
                "\\bTrainers with Shadow Pokémon are set up in ",
                "exactly the same way as any other trainer.",
              ),
              *text(
                "\\bAny Poké Ball can be defined as a Snag Ball in ",
                "items.txt. If $player.has_snag_machine is TRUE, ",
                "all types of Poké Ball will be Snag Balls automatically.",
              ),
              script("$player.has_snag_machine = true"),
              *text(
                "\\b$player.pokedex.owned_shadow is an array ",
                "that keeps track of which Shadow Pokémon species ",
                "have been caught.",
              ),
              jump_label("Choices"),
            ],
            choice3: [
              text("\\bYou can purify Shadow Pokémon in two ways."),
              *text(
                "\\bThe first is by bringing them to the Relic Stone here, ",
                "as in Pokémon Colosseum.",
              ),
              *text(
                "\\bThe second is by placing them in the Purify ",
                "Chamber, as in Pokémon XD. You can access it from ",
                "the PC in Poké Centers.",
              ),
              *condition(
                script: "!$player.seen_purify_chamber",
                then: [
                  text("\\bI've now given you access to the Purify Chamber."),
                  script("$player.seen_purify_chamber = true"),
                ],
              ),
              *text(
                "\\bThe effects of Heart Gauge-lowering items are ",
                "already in Essentials. You just need to add the items ",
                "themselves via a PBS file.",
              ),
              jump_label("Choices"),
            ],
          ),
        ],
      ),
    ),

